import React from 'react';
import './CreditInfoSection.css'; // Make sure the CSS file is in the same directory
// import creditTrendImage from './path-to-credit-trend-image.png'; // Update with the path to your image
// import creditStopImage from './path-to-credit-stop-image.png'; // Update with the path to your image

const CreditInfoSection = () => {
  return (
    <div className="credit-info-section">
      <div className="credit-info-block">
        {/* <img src={creditTrendImage} alt="Credit Trend Illustration" className="credit-info-image" /> */}
        <div className="credit-info-content">
          <h3>To track your credit score, EMI payment trends and much more</h3>
          <ul>
            <li>We will update you with monthly credit reports for 12 months.</li>
            <li>Helps in tracking your credit score trend, account mix and history of EMI payments.</li>
          </ul>
        </div>
      </div>
      <div className="credit-info-block">
        {/* <img src={creditStopImage} alt="Prevent Credit Score Fall Illustration" className="credit-info-image" /> */}
        <div className="credit-info-content">
          <h3>To stop your credit score from falling!</h3>
          <ul>
            <li>Helps in identifying accounts affecting your credit score.</li>
            <li>Get step by step guidance to resolve it.</li>
            <li>Get it corrected with the Credit Bureau.</li>
          </ul>
        </div>
      </div>
    </div>
  );
};

export default CreditInfoSection;
